import React from "react";
import ReactDOM from "react-dom/client";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./index.css";
import HomePage from "./landin_page/Home/HomePage";
import Signup from "./landin_page/signup/SignupPage";
import AboutPage from "./landin_page/about/AboutPage";
import ProductsPage from "./landin_page/products/ProductsPage";
import SupportPage from "./landin_page/support/SupportPage";
import Pricing from "./landin_page/Home/Pricing";
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <BrowserRouter>
    <Navbar />
    <Routes>
      <Route path="/" element={<HomePage />} />
      <Route path="/Signup" element={<Signup />} />
      <Route path="/about" element={<AboutPage />} />
      <Route path="/products" element={<ProductsPage />} />
      <Route path="/pricing" element={<Pricing />} />
      <Route path="/support" element={<SupportPage />} />
    </Routes>
    <Footer />
  </BrowserRouter>
);
